// src/pages/ProfileOnboarding.js
import React, { useState, useEffect } from "react";
import { useParams, useNavigate } from "react-router-dom";
import axios from "axios";
import "../styles/ProfileOnboarding.cs"; // Create a CSS file as needed

const ProfileOnboarding = () => {
  const { userId } = useParams();
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    hearingStatus: "hearing",
    reasonForLearning: "",
    skillLevel: "",
    phoneNumber: "",
    country: ""
  });
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);

  // If you need to load existing user data:
  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const res = await axios.get(`http://localhost:5000/api/users/${userId}`);
        // Fill formData with existing data
        const user = res.data.user;
        setFormData({
          hearingStatus: user.hearingStatus || "hearing",
          reasonForLearning: user.reasonForLearning || "",
          skillLevel: user.skillLevel || "",
          phoneNumber: user.phoneNumber || "",
          country: user.country || ""
        });
      } catch (err) {
        console.error(err);
      }
    };
    fetchUserData();
  }, [userId]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    setLoading(true);

    try {
      const res = await axios.patch(
        `http://localhost:5000/api/users/profile/${userId}`,
        formData
      );
      // On success, redirect to your main page or dashboard
      navigate("/");
    } catch (err) {
      setError(err.response?.data?.message || "Failed to update profile");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="onboarding-container">
      <h2>Complete Your Profile</h2>
      <p>Help us tailor the sign language experience to your needs.</p>
      
      <form onSubmit={handleSubmit} className="onboarding-form">
        <label htmlFor="hearingStatus">Hearing Status</label>
        <select
          id="hearingStatus"
          name="hearingStatus"
          value={formData.hearingStatus}
          onChange={handleChange}
        >
          <option value="hearing">Hearing</option>
          <option value="hard_of_hearing">Hard of Hearing</option>
          <option value="deaf">Deaf</option>
        </select>

        <label htmlFor="reasonForLearning">Reason for Learning</label>
        <textarea
          id="reasonForLearning"
          name="reasonForLearning"
          placeholder="Tell us why you're interested in sign language..."
          value={formData.reasonForLearning}
          onChange={handleChange}
        />

        <label htmlFor="skillLevel">Skill Level</label>
        <select
          id="skillLevel"
          name="skillLevel"
          value={formData.skillLevel}
          onChange={handleChange}
        >
          <option value="">Select your skill level</option>
          <option value="beginner">Beginner</option>
          <option value="intermediate">Intermediate</option>
          <option value="advanced">Advanced</option>
        </select>

        <label htmlFor="phoneNumber">Phone Number</label>
        <input
          type="tel"
          id="phoneNumber"
          name="phoneNumber"
          placeholder="Enter phone number"
          value={formData.phoneNumber}
          onChange={handleChange}
        />

        <label htmlFor="country">Country</label>
        <input
          type="text"
          id="country"
          name="country"
          placeholder="Enter your country"
          value={formData.country}
          onChange={handleChange}
        />

        {error && <p className="error">{error}</p>}
        <button type="submit" disabled={loading}>
          {loading ? "Updating..." : "Save & Continue"}
        </button>
      </form>
    </div>
  );
};

export default ProfileOnboarding;
